import React from "react";
import styles from "../styles/sidebarOption.module.scss";

function SidebarOption({ active, text, Icon }) {
  return (
    <div className={`sidebarOption `}>
      <Icon />
      <h2>{text}</h2>
    </div>
  );
}

export default SidebarOption;
